import { Box } from '@mui/system';
import React from 'react';

const Sidebar = () => {
  return (
    <Box
      bgcolor="lightseagreen"
      flex={1}
      p={2}
      sx={{ display: { xs: 'none', sm: 'block' } }}
    >
      
    </Box>
  );
};

export default Sidebar;
